webpackJsonp([0xa5ebb6e9a77e],{412:function(a,o){a.exports={data:{site:{siteMetadata:{title:"MAC0213 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/Projects/mac213-blog/src/pages/19-05/index.md absPath of file >>> MarkdownRemark",html:"<p>Durante a semana dos dias 19/05 à 25/05, continuei o trabalho de implementação da conteinerização da FATIMA.</p>\n<p>Com os resultados obtidos na semana anterior de ter conseguido subir o container da API, ainda não estava conseguindo fazer com que a API se comunicar com o módulo do banco de dados.</p>\n<p>Depois de conversar com o time da SMIT, apaguei a Dockerfile que tinha criado para o serviço e decidi utilizar a imagem do MariaDB disponível no Docker Hub sem alterações, movendo a responsabilidade de rodar comandos para iniciar o banco para o módulo do back-end, assim contornando um problema que estava enfrentando ao tentar rodar os scripts de configuração no banco antes mesmo dele ser iniciado.</p>\n<p><strong>Horas</strong>: 8 horas</p>",frontmatter:{title:"Conteinerização (Pt. 5)",date:"May 25, 2019"}}},pathContext:{slug:"/19-05/",previous:{fields:{slug:"/12-05/"},frontmatter:{title:"Conteinerização (Pt. 4)"}},next:{fields:{slug:"/26-05/"},frontmatter:{title:"Conteinerização (Pt. 6)"}}}}}});
